import { useEffect, useState } from "react";

const EURUSDrate = () => {
  const [eurusd, setEurusd] = useState(0);

  const getEURUSD = async () => {
    await fetch("https://v6.exchangerate-api.com/v6/e309146a2616c35941e159ef/latest/EUR").then(res => {
      const data =  res.json()
      console.log(data)
    })
  }

  useEffect(()=> {
    getEURUSD()
  })

  return <div>EUR/USD</div>;
};

export default EURUSDrate;
